    sorted_tasks = sorted(indexed_difficulties)
    res = [task[1] for task in sorted_tasks]
    swap = []
    for i in range(n - 1):
        if sorted_tasks[i][0] == sorted_tasks[i + 1][0]:
            swap.append((i, i + 1))
            if len(swap) == 2:
                plan1 = res[:]
                plan2 = res[:]
                (plan2[swap[0][0]], plan2[swap[0][1]]) = (plan2[swap[0][1]], plan2[swap[0][0]])
                plan3 = res[:]
                (plan3[swap[1][0]], plan3[swap[-1][1]]) = (plan3[swap[1][1]], plan3[swap[1][0]])
                return (plan1, plan2, plan3)
    return 'NO'

